import {
    faCircleQuestion,
    faGear,
    faHandsHelping,
    faHeart,
    faHome,
    faPaperPlane,
    faSave,
} from '@fortawesome/free-solid-svg-icons';
import { SideButton } from '../SideButton';

function Discover() {
    return (
        <div className="wrapper">
            <h1>Khám phá</h1>
            <SideButton children={'Món ăn trending'} icon={faGear} />
            <SideButton children={'Blog được yêu thích'} icon={faCircleQuestion} />
        </div>
    );
}

export default Discover;
